trailingComments.value:
*
 * 打开公益详情页
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example 调用示例
 *  libSQ.exec('open-commonweal-detail', {
 *   params: {
 *      id: '500087'
 *    }
 *  }).then(function (info) {
 *    alert('[from ready][open-commonweal-detail][then] ' + JSON.stringify(info, null, 2));
 *  }).catch(function (err) {
 *    alert('[from ready][open-commonweal-detail][error] ' + JSON.stringify(err, null, 2));
 *  });
 *

